"use strict";(self.webpackChunkcode=self.webpackChunkcode||[]).push([[477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"website-rewrite","metadata":{"permalink":"/blog/website-rewrite","source":"@site/blog/2022-03-28-website-rewrite.mdx","title":"Website Rewrite","description":"Asra\'s website just got a more modern and convenient design","date":"2022-03-28T00:00:00.000Z","formattedDate":"March 28, 2022","tags":[],"readingTime":0.33,"truncated":false,"authors":[{"name":"Mexi","title":"Developer Of Asra","imageURL":"https://cdn.discordapp.com/avatars/790191464406843424/9905dd3587b209d73677b539342621b0.webp?size=512","key":"mexi"}],"frontMatter":{"title":"Website Rewrite","description":"Asra\'s website just got a more modern and convenient design","slug":"website-rewrite","authors":"mexi"},"nextItem":{"title":"Advanced Configuration","permalink":"/blog/advanced-configuration"}},"content":"<head>\\r\\n    <meta name=\\"msvalidate.01\\" content=\\"85AA00B2E92F014958608F7C00D13667\\"/>\\r\\n    <meta name=\\"google-site-verification\\" content=\\"nSAM6lpRaPchS4fTEjt7DW5ia-_RigA0LgNRqj0-LEA\\"/>\\r\\n</head>\\r\\n\\r\\nWell It\'s finally done. Disguised and I have been planning on a new design for the website, and I am pleased to say, It\'s finally done.\\r\\nI\'ve been working on the new website for over a month (Since Feb 20, 2022)\\r\\n\\r\\nNew Features:\\r\\n- Dark And Light Theme\\r\\n- Improved Documentation\\r\\n- Improved Forms\\r\\n- Improved Main Page"},{"id":"advanced-configuration","metadata":{"permalink":"/blog/advanced-configuration","source":"@site/blog/2022-01-12-advanced-configuration.mdx","title":"Advanced Configuration","description":"Introducing Advanced Configuration! Asra just became a whole lot more customizable.","date":"2022-01-12T00:00:00.000Z","formattedDate":"January 12, 2022","tags":[],"readingTime":1.175,"truncated":false,"authors":[{"name":"Disguised","title":"Developer Of Asra","imageURL":"https://cdn.discordapp.com/avatars/728625544547008522/756c663cc121b6385ed16b704c6aa7f6.webp?size=512","key":"disguised"}],"frontMatter":{"title":"Advanced Configuration","description":"Introducing Advanced Configuration! Asra just became a whole lot more customizable.","slug":"advanced-configuration","authors":"disguised"},"prevItem":{"title":"Website Rewrite","permalink":"/blog/website-rewrite"},"nextItem":{"title":"Economy Upgrades & Going Public","permalink":"/blog/economy-upgrades-going-public"}},"content":"<head>\\r\\n    <meta name=\\"msvalidate.01\\" content=\\"85AA00B2E92F014958608F7C00D13667\\"/>\\r\\n    <meta name=\\"google-site-verification\\" content=\\"nSAM6lpRaPchS4fTEjt7DW5ia-_RigA0LgNRqj0-LEA\\"/>\\r\\n</head>\\r\\n\\r\\n### Introducing Advanced Configuration\\r\\n\\r\\nAsra is a fully customizable, multipurpose bot for your Discord server. Custom welcome messages, a global Economy system, Giveaways, Suggestions, Levelling, Moderation, QOTD and so much more are all included!\\r\\n\\r\\n#### Modules\\r\\n\\r\\nBelow are the modules which are customisable and can be setup in your server.\\r\\n\\r\\n- [Action Logs](/docs/commands/owner/#action-logs)\\r\\n- [Automod](/docs/commands/owner/#automod)\\r\\n- [Autoroles](/docs/commands/owner/#autoroles)\\r\\n- [Bump Reminders](/docs/commands/owner/#bump-reminders)\\r\\n- [Chatbot](/docs/commands/owner/#chatbot)\\r\\n- [Counting](/docs/commands/owner/#counting)\\r\\n- [Giveaways](/docs/commands/owner/#giveaways)\\r\\n- [Leave Message](/docs/commands/owner/#leave-message)\\r\\n- [Member Counter](/docs/commands/owner/#member-counter)\\r\\n- [Message Logs](/docs/commands/owner/#message-logs)\\r\\n- [Moderation Logs](/docs/commands/owner/#moderation-logs)\\r\\n- [Moderation - Warn](/docs/commands/owner/#moderation---warn)\\r\\n- [Moderation - Mute](/docs/commands/owner/#moderation---mute)\\r\\n- [Moderation - Kick](/docs/commands/owner/#moderation---kick)\\r\\n- [Moderation - Ban](/docs/commands/owner/#moderation---ban)\\r\\n- [Moderation - Muted Role](/docs/commands/owner/#moderation---muted-role)\\r\\n- [QOTD](/docs/commands/owner/#qotd)\\r\\n- [Suggestions](/docs/commands/owner/#suggestions)\\r\\n- [Welcome Message](/docs/commands/owner/#welcome-message)\\r\\n\\r\\nTo list all of the current settings for your server, use the command `/settings list`\\r\\n\\r\\nTo view a summary of which modules are enabled and disabled in your server, use the command `/modules`\\r\\n\\r\\nTo setup a module for first use, use the `/settings` command. More info can be found [here](/docs/commands/owner/#modules).\\r\\n\\r\\nTo enable/disable a module, use the `/toggle module [state] [module]` command.\\r\\n\\r\\n\\r\\n### Website Rewrite\\r\\n\\r\\nWebsite upgrades took place for serveral days at the end of December and again this week, simplifying the website and making it more intutive to find the things you need.\\r\\nStaff Applications for Asra Paradise also moved onto the website as opposed to the previous Google Form along with increased support and command information within the website."},{"id":"economy-upgrades-going-public","metadata":{"permalink":"/blog/economy-upgrades-going-public","source":"@site/blog/2021-12-14-economy-upgrades-going-public.mdx","title":"Economy Upgrades & Going Public","description":"A rewrite of the bot, going public and an inventory system - What more could you want from your favourite bot Asra?","date":"2021-12-14T00:00:00.000Z","formattedDate":"December 14, 2021","tags":[],"readingTime":1.75,"truncated":false,"authors":[{"name":"Disguised","title":"Developer Of Asra","imageURL":"https://cdn.discordapp.com/avatars/728625544547008522/756c663cc121b6385ed16b704c6aa7f6.webp?size=512","key":"disguised"}],"frontMatter":{"title":"Economy Upgrades & Going Public","description":"A rewrite of the bot, going public and an inventory system - What more could you want from your favourite bot Asra?","slug":"economy-upgrades-going-public","authors":"disguised"},"prevItem":{"title":"Advanced Configuration","permalink":"/blog/advanced-configuration"}},"content":"<head>\\r\\n    <meta name=\\"msvalidate.01\\" content=\\"85AA00B2E92F014958608F7C00D13667\\"/>\\r\\n    <meta name=\\"google-site-verification\\" content=\\"nSAM6lpRaPchS4fTEjt7DW5ia-_RigA0LgNRqj0-LEA\\"/>\\r\\n</head>\\r\\n\\r\\n### Slash command support\\r\\nAsra has recently migrated to slash commands and with it has brought a whole host of new commands and features as well as better uptime. Find all new commands using `/help`\\r\\n\\r\\n### Economy System\\r\\n- Brand new Inventory system\\r\\n- Sell items or gift items to other users\\r\\n- Weekly command for Premium Users\\r\\n- Economy commands no longer auto sell items collected but instead store them in your inventory where they can be sold or traded later.\\r\\nLots of items are planned to be added but suggestions are welcome.\\r\\n\\r\\n### Vote Rewards\\r\\nEach time you vote, you will now recieve 10,000 asra coins.\\r\\n\\r\\n### Christmas 2021 Exclusive Item\\r\\nFor a LIMITED TIME ONLY, using ANY slash commands has a 1 in 200 chance of giving you a Christmas Present. This is an exclusive item for Christmas 2021 which can\'t be bought or sold (Only traded). This will be a very valuable item due to its rarity.\\r\\n\\r\\n### Becoming a Public Bot\\r\\nI\'ve made the decision recently to open up the Asra bot to the public so everyone can now enjoy all the features it brings to the Asra Paradise community server themselves.<br/>\\r\\nAsra is a fully customizable, multipurpose discord bot with a global economy system, custom welcome messages, giveaways, moderation, anti-spam, auto roles, tickets, and much more!<br/>\\r\\nPlease support us and try the bot out in your server by clicking [here](https://discord.com/api/oauth2/authorize?client_id=751171098971865119&permissions=8&scope=applications.commands%20bot) to invite the bot!\\r\\n\\r\\n### Premium\\r\\nI\'ve made the decision to introduce Asra Premium which is the paid version of Asra.<br/>\\r\\nWhilst Asra is primarily a free bot, we have some premium only features to help support development and hopefully enable us to pay for hosting and improve the power and speed of the bot.<br/>\\r\\nTo learn more about how to redeem premium, visit our [Patreon](https://www.patreon.com/asraparadise).\\r\\n\\r\\n### Suggestions for Features\\r\\nAny suggestions for features or commands for the bot are welcome and can be submitted using `/botsuggest` or in the [Support Server](https://discord.com/invite/qwCzwBvRn9).\\r\\n\\r\\n\\r\\n**Thank you for your support and for choosing to have Asra in your server.**"}]}')}}]);